import React from 'react';

const MovieList = (props) => {
	return (
		<>
			{props.movies.map((movie, index) => (
				<div className='movie'>
					<p>{movie.title}</p>
					<img src={"https://image.tmdb.org/t/p/original/" + movie.poster_path} alt='movie'></img>
				</div>
			))}
		</>
	);
};

export default MovieList;
